import React from 'react';
import NavBar from '../NavBar/NavBar';  // Adjust the import path based on your directory structure
import './MainPage.css';

const MainPage = () => {
  return (
    <>
    <div>
      <h1>Welcome to CollectPie</h1>
      <p>Your ultimate tool for collecting, managing, and mastering words and phrases from around the world.</p>
      <button>Get Started</button>
    </div>
    </>
  );
};

export default MainPage;
